import React from 'react';
import { FaSearch } from 'react-icons/fa';

const Notes = () => {
  return (
    <section>
        <header className="notes__header">
            <h2>My Notes</h2>
            <input type="text" autoFocus placeholder='Keyword...'/>
            <button className='btn'><FaSearch /></button>
        </header>
    </section>
  )
}

export default Notes
